import React, { Component } from "react";
import { Link, Redirect } from "react-router-dom";

class changePass {
  async changePassword(email, oldpassword, newPassword, role) {
    await fetch(
      `/user/changepass/?email=${email}&&oldpassword=${oldpassword}newPassword=${newPassword}&&role=${role}`
    ).then((respone) => respone.json()) .then((Result) => {
        if (Result.status === "passChange") {
            console.log("passworded is c")
        }
    }
    );
  }
}
export default new changePass();
